import './App.css';
// import NavBar from './NavBar'
// import Main from './Main'
// import Projects from './Projects'
import Home from './Home'
import About from "./About"
import Contact from "./Contact"
import Resume from "./Resume"
import './NavButtons.css'
import {
  Route,
  NavLink,
  HashRouter
} from 'react-router-dom'


function App() {
  return (
    <div className="App">
        <HashRouter>
            <aside className="NavBar">

            <div className="NavButton"><NavLink to="/home"><span>Home</span></NavLink></div>
            <div className="NavButton"><NavLink to="/about"><span>About</span></NavLink></div>
            <div className="NavButton"><NavLink to="/contact"><span>Contact</span></NavLink></div>
            <div className="NavButton"><NavLink to="/resume"><span>Resume</span></NavLink></div> 

            </aside>
            <div className="content">
                <Route exact path="#/" component={App}/>
                <Route path="/about" component={About}/>
                <Route path="/contact" component={Contact}/>
                <Route path="/resume" component={Resume}/>
            </div>

            </HashRouter>
        {/* <NavBar /> 
        <div className="MainDiv">
          <Main />
        </div>
        <div className="ProjectDiv">
          <Projects />
        </div> */}
        <Home/>
    </div>
  );
}

export default App;
